import React, {useState} from "react";
import Main from "./components/Main";
import Header from "./components/Header";

function App() {
  const [cartDisplayHelper, setCartDisplayHelper] = useState(null);

  return (
    <React.Fragment>
      <Header cartDisplay = {cartDisplayHelper}></Header>
      <Main handler={(func) => setCartDisplayHelper(func)}></Main>
    </React.Fragment>
  );
}

export default App;
